import React, {useState} from "react"; 
import Maze from './Maze';
import Control_Module from './Control_Button';

function App() {

  Control_Module.Control_Button();
  const [mazeMatrix, updateMap] = useState([[]]);


  // const image = document.createElement('img');
  // image.src = ''; // Replace with the actual path to your image

  // const imageContainer = document.getElementById('imageContainer');
  // imageContainer.appendChild(image);


  React.useEffect(() => { ///See CORS
    fetch("http://localhost:3001/mazeMatrix/") 
        .then((res) => res.json())
        .then((data) => updateMap(data.mazeMatrix)) 
        .catch((err) => alert(err)
    );
  }, [updateMap]);

  const handleClickRandom = (updateMethod) => { 
    fetch("http://localhost:3001/mazeMatrix/")
      .then((res) => res.json())
      .then((data) => updateMethod(data.mazeMatrix)) 
      .catch((err) => alert(err)
    ); 
  }

  const handleClickMove = (updateMethod) => {
    fetch("http://localhost:3001/mazeMatrix/")
      .then((res) => res.json())
      .then((data) => updateMethod(data.mazeMatrix)) 
      .catch((err) => alert(err)
    ); 
  }


  return (
    <div className="App">
      <h1 style={{ fontSize: '36px' }}>EBB-Imperial   Maze</h1>
      <Maze td = {mazeMatrix}/>
      <button onClick={() => handleClickRandom(updateMap)}>Randomize Maze</button>
      <div id="buttonContainer"></div>
      {/* <div id="buttonContainer"></div> */}
      <img src="image/test_img.png" alt="Image description"></img>
      {/* <div id="pictureContainer"></div> */}
    </div> );
}
export default App;
